import React from "react";
import axios from "axios";
export default function Index({ post }) {
  console.log(post);
  return (
    <div>
      <ul>
        {post.map((p) => (
          <li
            key={p.id}
            style={{
              border: "1px solid #f4f4f4",
              margin: "5px",
              padding: "5px",
              color: "black",
            }}
          >
            {" "}
            <h3>{p.title}</h3>
            <p>{p.body}</p>
          </li>
        ))}
      </ul>
    </div>
  );
}

Index.getInitialProps = async () => {
  const post = await axios.get("https://jsonplaceholder.typicode.com/posts");
  const { data } = post;
  return { post: data };
};
